import React, { useState, useEffect } from 'react';
import Papa from 'papaparse';
import _ from 'lodash';

function App() {
  const [data, setData] = useState([]);
  const [sortConfig, setSortConfig] = useState({ key: null, direction: 'ascending' });
  const [filter, setFilter] = useState('');
  const [stats, setStats] = useState({ totalZones: 0, totalMonsters: 0 });

  useEffect(() => {
    const loadData = async () => {
      const response = await window.fs.readFile('Liste Complète des Monstres par Zone (Quest Ocre).docx', { encoding: 'utf8' });
      const parsedData = parseMonsterData(response);
      setData(parsedData);

      // Calculer les statistiques
      const uniqueZones = _.uniqBy(parsedData, 'zone').length;
      setStats({
        totalZones: uniqueZones,
        totalMonsters: parsedData.length
      });
    };
    loadData();
  }, []);

  const parseMonsterData = (text) => {
    const lines = text.split('\n');
    const data = [];
    let currentZone = '';

    lines.forEach(line => {
      line = line.trim();
      if (!line) return;

      if (line.startsWith('#')) {
        currentZone = line.replace(/#/g, '').trim();
      } else if (line.startsWith('•')) {
        const monsterInfo = line.replace('•', '').trim();
        const matches = monsterInfo.match(/(.*?)\s*\((\d+)\)\s*$/);

        if (matches) {
          data.push({
            zone: currentZone,
            monster: matches[1].trim(),
            level: parseInt(matches[2])
          });
        }
      }
    });

    return data;
  };

  const sortData = (key) => {
    let direction = 'ascending';
    if (sortConfig.key === key && sortConfig.direction === 'ascending') {
      direction = 'descending';
    }
    setSortConfig({ key, direction });
  };

  const getSortedData = () => {
    const sortedData = [...data];
    if (sortConfig.key) {
      sortedData.sort((a, b) => {
        if (a[sortConfig.key] < b[sortConfig.key]) {
          return sortConfig.direction === 'ascending' ? -1 : 1;
        }
        if (a[sortConfig.key] > b[sortConfig.key]) {
          return sortConfig.direction === 'ascending' ? 1 : -1;
        }
        return 0;
      });
    }
    return sortedData;
  };

  const getFilteredData = () => {
    return getSortedData().filter(item =>
      Object.values(item).some(val =>
        val.toString().toLowerCase().includes(filter.toLowerCase())
      )
    );
  };

  const filteredData = getFilteredData();
  const filteredStats = {
    totalZones: _.uniqBy(filteredData, 'zone').length,
    totalMonsters: filteredData.length
  };

  return (
    <div className="w-full max-w-6xl mx-auto p-4">
      <div className="mb-4">
        <input
          type="text"
          placeholder="Rechercher..."
          className="w-full p-2 border border-gray-300 rounded"
          value={filter}
          onChange={(e) => setFilter(e.target.value)}
        />
      </div>

      <div className="grid grid-cols-2 gap-4 mb-4">
        <div className="bg-blue-100 p-4 rounded-lg">
          <div className="text-lg font-bold">Nombre total de zones</div>
          <div className="text-3xl font-bold text-blue-600">
            {filter ? `${filteredStats.totalZones} / ${stats.totalZones}` : stats.totalZones}
          </div>
        </div>
        <div className="bg-green-100 p-4 rounded-lg">
          <div className="text-lg font-bold">Nombre total de monstres</div>
          <div className="text-3xl font-bold text-green-600">
            {filter ? `${filteredStats.totalMonsters} / ${stats.totalMonsters}` : stats.totalMonsters}
          </div>
        </div>
      </div>

      <div className="overflow-x-auto shadow-md rounded-lg">
        <table className="w-full text-sm text-left">
          <thead className="text-xs text-gray-700 uppercase bg-gray-100">
            <tr>
              <th 
                className="px-6 py-3 cursor-pointer hover:bg-gray-200"
                onClick={() => sortData('zone')}
              >
                Zone {sortConfig.key === 'zone' && (sortConfig.direction === 'ascending' ? '↑' : '↓')}
              </th>
              <th 
                className="px-6 py-3 cursor-pointer hover:bg-gray-200"
                onClick={() => sortData('monster')}
              >
                Monstre {sortConfig.key === 'monster' && (sortConfig.direction === 'ascending' ? '↑' : '↓')}
              </th>
              <th 
                className="px-6 py-3 cursor-pointer hover:bg-gray-200"
                onClick={() => sortData('level')}
              >
                Niveau {sortConfig.key === 'level' && (sortConfig.direction === 'ascending' ? '↑' : '↓')}
              </th>
            </tr>
          </thead>
          <tbody>
            {filteredData.map((item, index) => (
              <tr 
                key={index}
                className="bg-white border-b hover:bg-gray-50"
              >
                <td className="px-6 py-2">{item.zone}</td>
                <td className="px-6 py-2">{item.monster}</td>
                <td className="px-6 py-2">{item.level}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};


export default App;
